import "./style.css"
import { Button } from "../button"
import NuKenzieBlack from "../assets/NuKenzieBlack.png"


export const Header = ({ children }) => {
    return (
        <header>
            <nav>
                <img src={NuKenzieBlack} alt="Logo" />
                <Button className={"btnInicio"}>Inicio</Button>
            </nav>
        </header>
    )
}
